const ProductLockup = ({
	product,
	mark,
	type,
	href,
	size
}: {
	product: keyof typeof products;
	mark?: boolean;
	type?: boolean;
	href?: string;
	size?: number;
}) => {
	const productData = products[product];

	let width = 0;

	if (mark) width += productData.logoWidth;
	if (type) width += productData.wordtypeWidth;

	const ParentEl = (props: any) =>
		href
			? createElement(
					Link,
					{
						...props,
						class: "fdn-not-visited",
						href,
						"aria-label": productData.label
					} as any,
					props.children
			  )
			: createElement(Fragment, props, props.children);

	return (
		<div class="fdn-logo">
			<ParentEl>
				<svg
					alt={productData.label}
					aria-label={productData.label}
					viewBox={`0 0 ${width} 32`}
					width={size ? size : width}
					height={size ? size : 32}
					fill="none"
					xmlns="http://www.w3.org/2000/svg"
					xmlnsXlink="http://www.w3.org/1999/xlink"
				>
					{type && <productData.wordtype />}
					{mark && <productData.logo />}
				</svg>
			</ParentEl>
		</div>
	);
};

export default ProductLockup;
